export default "import React, {useState, useEffect} from 'react'\nimport Tabs from '@material-ui/core/Tabs';\nimport Tab from '@material-ui/core/Tab';\nimport AppBar from '@material-ui/core/AppBar';\n\nexport default (props)=>{\n    const [value, setValue] = useState(/*replaceme*/props.value)\n\n    useEffect(()=>{\n        if(props.value !== value){\n            setValue(Number(props.value))\n        }\n    // eslint-disable-next-line react-hooks/exhaustive-deps\n    },[props.value])\n\n    const handleChange = (e,newValue)=>{\n        setValue(newValue)\n    }\n\n    let selectedText = props.tabs && props.tabs.find((item,index)=>{return index === value})\n\n    return (<div>\n        <AppBar position=\"static\">\n            <Tabs \n                onChange={handleChange} \n                aria-label=\"simple tabs example\" \n                {...props} \n                value={value}>\n                {props.tabs && props.tabs.map(item=>{\n                    return <Tab label={item.label} index={item.label} />\n                })}\n            </Tabs>\n        </AppBar> \n        {selectedText ? selectedText.label : ''}\n    </div>)\n}";